import 'bootstrap/dist/css/bootstrap.min.css'
import {Container, Navbar} from 'react-bootstrap'

function NavBar() {
    return(
        <Navbar expand="lg" style={{color:'#355173'}}>
        <Container fluid>
          <Navbar.Brand href="#home">Navbar</Navbar.Brand>
        </Container>
      </Navbar>
    );
}

export default NavBar;
